import GoalItem from "./GoalItem";
import "./GoalItemList.css";
function GoalItemList(props){
    const deleteGoalHandler = (event)=>{
        console.log(event);
    }
    return(
        <div className="goal-items">
            {props.items.map(goal=> <GoalItem key={goal.id} title={goal.title} onClick={deleteGoalHandler}/>)}
        </div>
    );
}
export default GoalItemList;
